-- Habilitar extensiones necesarias
CREATE EXTENSION IF NOT EXISTS postgis;
CREATE EXTENSION IF NOT EXISTS pgrouting;
SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "public"."waterways" (gid serial,
"osm_id" float8,
"name" varchar(48),
"type" varchar(16),
"width" int2);
ALTER TABLE "public"."waterways" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('public','waterways','geom','4326','MULTILINESTRING',2);
CREATE INDEX ON "public"."waterways" USING GIST ("geom");
COMMIT;
ANALYZE "public"."waterways";
